// Original license: SPDX_License_Identifier: MIT
pragma solidity ^0.8.20;
contract PRCC_Vesting is VestingWallet {

    string _username;

    constructor(address beneficiary, uint64 startTimestamp, uint64 durationSeconds,string memory username)
    VestingWallet(beneficiary,startTimestamp,durationSeconds)
    {
        _username=username;
    }

// ?3 ?"03"?
    function _padZero(uint256 n) internal pure returns (string memory) {
        if (n < 10) {
            return string.concat("0", _uintToString(n));
        }
        return _uintToString(n);
    }

    // int ?string?
    function _uintToString(uint256 value) internal pure returns (string memory) {
        if (value == 0) return "0";
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits--;
            buffer[digits] = bytes1(uint8(48 + value % 10));
            value /= 10;
        }
        return string(buffer);
    }

    // ?
    function _parseInt(bytes memory b, uint256 start, uint256 length) private pure returns (uint256) {
        uint256 result = 0;
        for (uint256 i = start; i < start + length; i++) {
            require(b[i] >= 0x30 && b[i] <= 0x39, "Invalid digit"); // ?-9
            result = result * 10 + (uint256(uint8(b[i])) - 48);
        }
        return result;
    }

    // 
    function _isLeapYear(uint256 year) private pure returns (bool) {
        return (year % 4 == 0 && year % 100 != 0) || (year % 400 == 0);
    }


    function _stringToTimestamp(string memory dateStr) private pure returns (uint256) {
        bytes memory b = bytes(dateStr);
        require(b.length == 10 || b.length == 19, "Invalid format (use YYYY-MM-DD or YYYY-MM-DD hh:mm:ss)");

        // SCII
        uint256 year = _parseInt(b, 0, 4);  // ??
        uint256 month = _parseInt(b, 5, 2); // 5-6?
        uint256 day = _parseInt(b, 8, 2);   // 8-9?

        uint256 hour = 0;
        uint256 minute = 0;
        uint256 second = 0;

        if(b.length==19){
            hour =  _parseInt(b, 11, 2);
            minute =  _parseInt(b, 14, 2);
            second =  _parseInt(b, 17, 2);
        }


        // ?
        require(month >= 1 && month <= 12, "Invalid month");
        require(day >= 1 && day <= 31, "Invalid day");

        require(hour >= 0 && hour <= 23, "Invalid hour");
        require(minute >= 0 && minute <= 59, "Invalid minute");
        require(second >= 0 && second <= 59, "Invalid second");

        // ?
        uint256 timestamp = 0;
        for (uint256 i = 1970; i < year; i++) {
            timestamp += _isLeapYear(i) ? 31622400 : 31536000; // ??
        }

        uint256[] memory daysInMonth = new uint256[](12);
        daysInMonth[0] = 31;
        daysInMonth[1] = 28;
        daysInMonth[2] = 31;
        daysInMonth[3] = 30;
        daysInMonth[4] = 31;
        daysInMonth[5] = 30;
        daysInMonth[6] = 31;
        daysInMonth[7] = 31;
        daysInMonth[8] = 30;
        daysInMonth[9] = 31;
        daysInMonth[10] = 30;
        daysInMonth[11] = 31;
        if (_isLeapYear(year)) daysInMonth[1] = 29;

        for (uint256 j = 1; j < month; j++) {
            timestamp += daysInMonth[j-1] * 86400;
        }
        timestamp += (day - 1) * 86400;

        timestamp += hour*3600 + minute*60 + second;

        //unix
        timestamp -= 8*3600;

        return timestamp;
    }

    function _toUint64Safe(uint256 value) private pure returns (uint64) {
        require(value <= type(uint64).max, "Value overflow");
        return uint64(value);
    }

    function getUsername() public view returns (string memory) {
        return _username;
    }

    function startDateTime() public view returns (string memory) {
        uint256 timestamp = start();

        //?
        uint256 newTimestamp = BokkyPooBahsDateTimeLibrary.addHours(timestamp, 8);

        (uint year, uint month, uint day, uint hour, uint minute, uint second) = BokkyPooBahsDateTimeLibrary.timestampToDateTime(newTimestamp);

        return string.concat(
            _uintToString(year) , "-", _padZero(month) , "-", _padZero(day), ' ',
            _padZero(hour) , ":", _padZero(minute) , ":", _padZero(second)
        );

    }

    function endDateTime() public view returns (string memory) {
        uint256 timestamp = end();

        //?
        uint256 newTimestamp = BokkyPooBahsDateTimeLibrary.addHours(timestamp, 8);

        (uint year, uint month, uint day, uint hour, uint minute, uint second) = BokkyPooBahsDateTimeLibrary.timestampToDateTime(newTimestamp);

        return string.concat(
            _uintToString(year) , "-", _padZero(month) , "-", _padZero(day), ' ',
            _padZero(hour) , ":", _padZero(minute) , ":", _padZero(second)
        );

    }

    function vestedAmountWithDateTime(address token, string memory dateTime) public view virtual returns (string memory) {


        uint256 timestamp=_stringToTimestamp(dateTime);

        uint256 value = vestedAmount(token,_toUint64Safe(timestamp));

        // return value/1000000000000000000;

        uint256 v1 = value/1000000000000000000;
        uint256 v2 = value%1000000000000000000;

        return string.concat(_uintToString(v1) , ".", _uintToString(v2) );
    }

    function dateTimeToTimestamp(string memory dateTime) public view virtual returns (uint64) {


        uint256 timestamp=_stringToTimestamp(dateTime);

        return _toUint64Safe(timestamp);
    }


}

